import React from 'react';
import Birthcake from '../img/Birthdaycake.png';

function EventPage() {
  return (
    <section className="home-page">
      <img src={Birthcake} alt="Birthdaycake" />
      <h2>Birthday Bash</h2>
      <p>
        Hosted by Elysia
      </p>
      <div className="date">
        <h4>18 August 6:00PM</h4>
        <p>19 August 1:00PM UTC +10</p>
      </div>
      <div className="stname">
        <h4>Street</h4>
        <p>Suburb, State, Postcode</p>
      </div>
    </section>
  );
}

export default EventPage;
